      const metalness = parseFloat(metalnessSlider.value);
      
      roughnessValue.textContent = roughness.toFixed(2);
      metalnessValue.textContent = metalness.toFixed(2);

      const colorRgb = [
        parseInt(colorHex.substring(1, 3), 16) / 255,
        parseInt(colorHex.substring(3, 5), 16) / 255,
        parseInt(colorHex.substring(5, 7), 16) / 255
      ];
      
      modelViewer.model.materials.forEach(material => {
        if (material.pbrMetallicRoughness) {
            material.pbrMetallicRoughness.setBaseColorFactor([...colorRgb, 1]);
            material.pbrMetallicRoughness.setRoughnessFactor(roughness);
            material.pbrMetallicRoughness.setMetallicFactor(metalness);
        }
      });
    };
    
    modelViewer.addEventListener('load', () => {
      // Apply initial values set from the app
      applyMaterialProperties();

      // Add event listeners for live updates
      colorPicker.addEventListener('input', applyMaterialProperties);
      roughnessSlider.addEventListener('input', applyMaterialProperties);
      metalnessSlider.addEventListener('input', applyMaterialProperties);
      
      // Animation script
      
      
      // Links script
      
    });
  </script>
</body>
